import React from "react";
import pages from "/src/mocks/pages";
import { Li, A } from "/src/components/styled";
import { StyledUl } from "./styles";

function Nav() {
  return pages && pages.length ? (
    <nav>
      <StyledUl>
        {pages.map((page) => (
          <Li key={page.id}>
            <A href="/">{page.name}</A>
          </Li>
        ))}
      </StyledUl>
    </nav>
  ) : null;
}

export default Nav;
